@Tania: Hi! :)
@Laura: Thanks!! What did you guys do in your office?
@Jennifer: Great to hear! Did your team do anything fun to celebrate?

@Steve: check out our open positions on our 'search jobs' tab above and see if any opportunities match your skill set. Good luck!
@Sharon: continue applying for positions that match your experience and make sure you are flexible with your hours. This could help your application. Make sure you are looking at the requirements for each job you are applying to and identifying whether or not your past experiences match with the criteria before applying. If they do, please apply but understand our recruiters have high volumes of applicants and will hopefully get to you as soon as they can. Thanks!
@Chance: Yes our internships are paid. Please apply online if any interest you!

@Matt: yes, I agree with Sandra. Apply online to a position you are interested in!
@Jenna: What type of position are you looking for? Most of our call centers do have computers set up where you can apply on-site. If you are close to one, feel free to stop by.
@Gregory: Great to hear! Good luck!
